import React, { useState, useEffect} from 'react'
import { motion } from 'framer-motion';


import './About.scss';
const About = () => {
  return (
    <>
      <h2 className='head-text'>I know that 
      <span>good design</span>
      <br/>
      means
      <span>good business.</span>
      </h2>
    </>
  )
}

export default About
